Presently Red Cross is Managing;
Blood Bank, special school for Handicap Children, Mobile Dispensary, Computer Education Centre, Ambulatory and Hearse Service,Childline, Eye Bank, First Aid Training, Medical Camps.
In recognition of our services, the Branch has bagged Trophy on National Level for its performance and fund raising campaign and also for motivation of blood donors ans collection of highest number of Blood units per lakh population for five/ten Years. These trophies were presented by the President of India on various occasions. The Secretary of this UT Branch Shri Kuldip Singh has also been recognized by the Administration at UT level and awarded the shield on two occasions in the state function on Republic day- 2010, 2014 and 2015. The Secretary of this UT Branch Shri Kuldip Singh has also been awarded the Gold Medal by the President of India for dedicated, devoted and meritorious service.  The Secretary of the branch has also been felicitated with Bharat Gaurav Award for outstanding service for welfare of people; particularly the down trodden
